import React from 'react';

const LoginPage = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
      }}
    >
      <div
        style={{
          backgroundColor: '#1f2a3a',
          color: 'white',
          padding: '40px',
          borderRadius: '8px',
          width: '100%',
          maxWidth: '400px',
        }}
      >
        <div
          style={{
            display: 'flex',
            justifyContent: 'center',
            marginBottom: '32px',
          }}
        >
          <img
            src="book-icon.svg"
            alt="Book Icon"
            style={{ width: '64px' }}
          />
        </div>
        <h1 style={{ textAlign: 'center', fontSize: '24px', marginBottom: '24px' }}>
          Book Rent
        </h1>
        <div style={{ spaceY: '16px' }}>
          <input
            type="email"
            placeholder="Email address"
            style={{
              width: '100%',
              padding: '12px 16px',
              borderRadius: '8px',
              backgroundColor: '#2c3849',
              border: 'none',
              color: 'white',
            }}
          />
          <input
            type="password"
            placeholder="Password"
            style={{
              width: '100%',
              padding: '12px 16px',
              borderRadius: '8px',
              backgroundColor: '#2c3849',
              border: 'none',
              color: 'white',
            }}
          />
          <div style={{ display: 'flex', alignItems: 'center' }}>
            <input type="checkbox" style={{ marginRight: '8px' }} />
            <span style={{ color: '#999999', fontSize: '14px' }}>Remember me</span>
          </div>
          <button
            style={{
              width: '100%',
              backgroundColor: '#007bff',
              color: 'white',
              fontWeight: 'bold',
              padding: '12px 0',
              borderRadius: '8px',
              cursor: 'pointer',
            }}
          >
            Login
          </button>
        </div>
        <div
          style={{
            textAlign: 'center',
            marginTop: '16px',
            color: '#999999',
            fontSize: '14px',
            cursor: 'pointer',
          }}
        >
          Haven't got an account? Sign up
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
